values:
I'm going to WESTFARMS tomorrow w/ Julia!!! I'm so excited! I'm gonna need to scrape some money from Mama for like lunch or something. 

Julia, if you see this, I'm probably going to have to go to mass tomorrow so if you call and leave a messgae I'll def. call you back after obviously lol. Can't wait!!


Mary should be home tonight&hearts;

Okay so yesterday I went to Lake Compounce with Michelle, her mm, and Jaimie. It was alot of fun. I went on some rides I never would've dared to go on before. Like um Boulder Dash. It was psycho, it just like whips you around really fast for like 2 minutes and then its done. It hurt. But I had fun, I faced my fears of roller coasters and high rides and I'm happy about that. I learned that some of them do suck like I thought they would but others are really awesome. I love Shell. She and Jaimie are an awesome couple. I'm so happy for them.

I just got turned down for a job at The Childrens Place at least until like late August. I'm going to apply at Lindt Chocolate and JoAnn Fabrics tomorrow because my mom is off. I'm fuckin scared that I'm not gonna get a job and I really need one. I really do. My parents tried to set me up with one in freakin washington, CT bussing tables for my dads friend. Yeah no thanks. Ew, I am not letting them help me get a job.

I'm calling Mary&hearts;

I'm just sitting here listening to "Such Great Heights" and thinking of that special girl and how I miss her and wish to hear her voice and how I wanna go to a bookstore with an air mattress and a blanket with my best friend and live Happily Ever After.


I love Michelle. We had fun tonight.



I love you Mary&hearts;
